package com.bobwang.lintcode.bfs;

import java.util.Arrays;
import java.util.HashSet;
import java.util.Set;

/**
 * Created by cwang on 3/26/17.
 */
public class WordBreak {
    public static void main(String[] args) {
        WordBreak wb = new WordBreak();
        Set<String> dict = new HashSet<String>();
        dict.addAll(Arrays.asList(new String[]{"a", "b", "c", "d", "e", "f", "g"}));
//        dict.addAll(Arrays.asList(new String[]{"lint", "code"}));

        StringBuilder sb = new StringBuilder();
        sb.append("").append(
                "").append("");
//
//        sb.append("lintcode");
        System.out.println(wb.wordBreak(sb.toString(), dict));
    }

    public boolean wordBreak(String s, Set<String> dict) {
        // write your code here
        if (s == null || s.length() == 0) {
            return true;
        }

        int len = s.length();

        if (dict == null || dict.size() == 0) {
            return false;
        }

        boolean[] canBreak = new boolean[len + 1];
        canBreak[0] = true;
        for (int i = 1; i < len; i++) {
            canBreak[i] = false;
            for (int j = 0; j < i; j++) {
                if (canBreak[j] && dict.contains(s.substring(j, i))) {
                    canBreak[i] = true;
                }
                break;
            }
        }
        return canBreak[len];
    }
}
